import {Map,TileLayer} from "react-leaflet"

import React, { useState } from 'react'
import { useRef } from "react";

export default function Google() {
  const URL='https://api.maptiler.com/maps/openstreetmap/256/tiles.json?key=dRBcNEdtSd7c6ongeY2O';
  const ATTRIBUTE='https://api.maptiler.com/maps/openstreetmap/256/{z}/{x}/{y}.jpg?key=dRBcNEdtSd7c6ongeY2O';
  const [center,setCenter]=useState({lat:13.084622,lng:80.248357});
  const zoom_level=9;
  const mapRef=useRef();
  return (
    <div style={{width:'500px',height:'500px'}}>
           <Map
            center={center}
            zoom={zoom_level}
            
           >
             <TileLayer url={URL} attribution={ATTRIBUTE}/>
           </Map>
    </div>
  )
}
